var $bm_rt;
var trigger, triggerMarker, offset, tDifMax, i;
trigger = comp(thisLayer.source._name).layer('Trigger');
var preMarker = 0;
if (marker.numKeys > 0) {
    $bm_rt = preMarker = marker.nearestKey(time).index;
    if (marker.key(preMarker).time > time) {
        preMarker--;
    }
}
if (preMarker == 0) {
    $bm_rt = 0;
} else {
    var mostRecent = marker.key(preMarker);
    var layerMarkerName = mostRecent.comment;
    var tDif = $bm_sub(time, mostRecent.time);
    try {
        triggerMarker = trigger.marker.key(layerMarkerName);
        if (trigger.marker.numKeys > triggerMarker.index) {
            offset = $bm_sub(timeToFrames(trigger.marker.key($bm_sum(triggerMarker.index, 1)).time), 1);
            tDifMax = $bm_sub(framesToTime(offset), triggerMarker.time);
        } else {
            tDifMax = $bm_sub(trigger.outPoint, triggerMarker.time);
        }
        tDif = Math.min(tDif, tDifMax);
        $bm_rt = $bm_sum(triggerMarker.time, tDif);
    } catch (err) {
        try {
            for (i = 1; i <= trigger.marker.numKeys; i++) {
                if (layerMarkerName.toLowerCase() == trigger.marker.key(i).comment.toLowerCase()) {
                    layerMarkerName = trigger.marker.key(i).comment;
                }
            }
            triggerMarker = trigger.marker.key(layerMarkerName);
            if (trigger.marker.numKeys > triggerMarker.index) {
                offset = $bm_sub(timeToFrames(trigger.marker.key($bm_sum(triggerMarker.index, 1)).time), 1);
                tDifMax = tDifMax = framesToTime(offset) - triggerMarker.time;
            } else {
                tDifMax = $bm_sub(trigger.outPoint, triggerMarker.time);
            }
            tDif = Math.min(tDif, tDifMax);
            $bm_rt = $bm_sum(triggerMarker.time, tDif);
        } catch (err) {
            $bm_rt = 0;
        }
    }
}

